import React from 'react';
import './homepage.css';

export default function Homepage() {
    return (
        <div className="titlebar">
            <h1 className="title">Fuud Fair</h1>
            
            <input className="search" type="text" placeholder="Search Through Our Products"></input>
    
            <button>Search</button>

    
        </div>
    )
}
